import{_ as t}from"./chunks/freefly_gps_module.DgIbYJ4a.js";import{_ as l,c as r,a8 as a,o as i}from"./chunks/framework.BDnHobkS.js";const m=JSON.parse('{"title":"Freefly Systems RTK GPS","description":"","frontmatter":{},"headers":[],"relativePath":"ko/gps_compass/rtk_gps_freefly.md","filePath":"ko/gps_compass/rtk_gps_freefly.md"}'),o={name:"ko/gps_compass/rtk_gps_freefly.md"};function s(d,e,n,h,p,f){return i(),r("div",null,e[0]||(e[0]=[a('<h1 id="freefly-systems-rtk-gps" tabindex="-1">Freefly Systems RTK GPS <a class="header-anchor" href="#freefly-systems-rtk-gps" aria-label="Permalink to &quot;Freefly Systems RTK GPS&quot;">​</a></h1><p>The <a href="https://store.freeflysystems.com/products/rtk-gps-ground-station" target="_blank" rel="noreferrer">Freefly Systems RTK GPS Module</a> is a multiband <a href="./../gps_compass/rtk_gps.html">RTK GPS module</a> from Freefly Systems that provides highly reliable navigation. 모듈은 로버(항공기에 설치된 경우) 또는 기지국(컴퓨터에 연결된 경우)으로 작동할 수 있습니다.</p><p>주요 특징은 다음과 같습니다.</p><ul><li>Multiband (L1/L2) 수신기 (u-blox ZED-F9P)</li><li>최대 4 개의 GNSS(GPS, Galileo, GLONASS, BeiDou) 동시 수신</li><li>내장형 자력계(IST8310), 기압계(BMP388), RGB LED, 안전 스위치 및 안전 LED</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This module can be used with PX4 v1.9 or above (support for the u-blox ZED-F9P was added in PX4 v1.9).</p></div><p><img src="'+t+'" alt="FreeFly GPS Module"></p><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><ul><li><a href="https://store.freeflysystems.com/products/rtk-gps-ground-station" target="_blank" rel="noreferrer">Freefly Store</a></li></ul><h2 id="키트-내용물" tabindex="-1">키트 내용물 <a class="header-anchor" href="#키트-내용물" aria-label="Permalink to &quot;키트 내용물&quot;">​</a></h2><p>RTK GPS 키트에는 다음 내용물들이 포함됩니다.</p><ul><li>안테나가 있는 GPS 모듈 2개</li><li>3m USB C to A 케이블</li><li>베이스 스테이션 모듈용 마그네틱 퀵 마운트 (삼각대 마운트용 1/ 4-20 스레드)</li><li>Freefly AltaX에 장착하는 나사</li></ul><h2 id="설정" tabindex="-1">설정 <a class="header-anchor" href="#설정" aria-label="Permalink to &quot;설정&quot;">​</a></h2><p>RTK setup and use on PX4 via <em>QGroundControl</em> is largely plug and play (see <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> for more information).</p><p>For the aircraft, you should set the parameter <a href="./../advanced_config/parameter_reference.html#SER_GPS1_BAUD">SER_GPS1_BAUD</a> to 115200 8N1 to ensure that PX4 configures the correct baudrate.</p><h2 id="배선" tabindex="-1">배선 <a class="header-anchor" href="#배선" aria-label="Permalink to &quot;배선&quot;">​</a></h2><p>Freefly RTK GPS는 PixHawk 자동조종장치에 연결할 수있는 8핀 JST-GH 커넥터와 함께 제공됩니다. 모듈에는 베이스 스테이션용 USB-C 커넥터가 있습니다.</p><h3 id="핀배열" tabindex="-1">핀배열 <a class="header-anchor" href="#핀배열" aria-label="Permalink to &quot;핀배열&quot;">​</a></h3><p>Freefly GPS 핀배열은 아래와 같습니다. For some autopilots, like the <a href="./../flight_controller/pixhawk-2.html">Hex Cube</a> and <a href="./../flight_controller/pixracer.html">PixRacer</a>, all that is needed is a 1-1 8-pin JST-GH cable.</p><table tabindex="0"><thead><tr><th>핀</th><th>Freefly GPS</th></tr></thead><tbody><tr><td>1</td><td>VCC_5V</td></tr><tr><td>2</td><td>GPS_RX</td></tr><tr><td>3</td><td>GPS_TX</td></tr><tr><td>4</td><td>I2C_SCL</td></tr><tr><td>5</td><td>I2C_SDA</td></tr><tr><td>6</td><td>BUTTON</td></tr><tr><td>7</td><td>BUTTON_LED</td></tr><tr><td>8</td><td>GND</td></tr></tbody></table><h2 id="사양" tabindex="-1">사양 <a class="header-anchor" href="#사양" aria-label="Permalink to &quot;사양&quot;">​</a></h2><ul><li>u-blox ZED-F9P GPS 수신기 <ul><li>빠른 (핫 스타트) 재시작을 위한 Ultracap 백업 전원</li><li>향상된 EMI 내성을 위한 수신기를 통한 EMI 차폐</li></ul></li><li>IST8310 자력계</li><li>안전 스위치 및 안전 LED</li><li>상태표시용 RGB LED <ul><li>NCP5623CMUTBG I2C 드라이버</li></ul></li><li>I2C 버스의 BMP388 기압계</li><li>외부 활성 안테나(Maxtena M7HCT) <ul><li>SMA 커넥터</li></ul></li><li>미래의 CAN 기반 통신을 위한 STM32 MCU <ul><li>USB 커넥터를 통한 펨웨어 업데이트</li></ul></li><li>Connectivity: <ul><li>USB-C</li><li>MCU 및 F9P에 대한 양방향 USB 스위치</li><li>활성 안테나용 SMA (최대 20mA)</li><li>4핀 JST-GH CAN 버스(드론코드 준수)</li><li>8-pin JST-GH UART/I2C -** Power:</li><li>Input from either (diode OR&#39;d):</li><li>USB (5V)</li><li>CAN (4.7 ~ 25.2V)</li><li>(4.7 ~ 25.2V)</li><li>Power consumption &lt;1W</li></ul></li></ul><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><p>More information can be found on <a href="https://freefly.gitbook.io/freefly-public/products/rtk-gps" target="_blank" rel="noreferrer">Freefly&#39;s Wiki</a></p>',23)]))}const S=l(o,[["render",s]]);export{m as __pageData,S as default};
